    "lake-andes-wetland-management-district-annual-narrative-report-calendar-year-1984",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Lake Andes Wetland
    Management District outlines District accomplishments during the 1984 calendar year.
    The report begins with an introduction to the District and information about weather
    conditions, habitat conditions, land acquisition activities, and administration.
    Construction, maintenance, and wildfires are also described. Habitat management
    is covered; croplands, grasslands, wetlands, forests, grazing, haying, vegetation
    control, and easements for waterfowl management are discussed. The wildlife section
    of the report discusses endangered and threatened species, migratory birds, game
    animals, raptors, and disease prevention and control. Interpretation and recreation
    activities are outlined; topics include information and interpretation, recreation,
    and law enforcement. Cooperative programs, items of interest, and newspaper articles
    are attached.",nt"license_title": "License Not Specified",nt"extras":
